def prod_signs(arr):
    if not arr:
        return None
    product_of_signs = 1
    sum_of_magnitudes = 0
    for num in arr:
        if num > 0:
            product_of_signs *= 1
        elif num < 0:
            product_of_signs *= -1
        sum_of_magnitudes += abs(num)
    return product_of_signs * sum_of_magnitudes

from heapq import heappop, heappush

def minPath(grid, k):
    N = len(grid)
    directions = [(0, 1), (1, 0), (-1, 0), (0, -1)]
    value_to_pos = {grid[i][j]: (i, j) for i in range(N) for j in range(N)}
    paths = [[float('inf')] * (k + 1) for _ in range(N * N + 1)]
    paths[1][1] = value_to_pos[1]
    pq = [(1, 1, value_to_pos[1])]  # cost, length, position

    while pq:
        cost, length, pos = heappop(pq)
        if length == k:
            break
        for d in directions:
            new_pos = (pos[0] + d[0], pos[1] + d[1])
            if 0 <= new_pos[0] < N and 0 <= new_pos[1] < N:
                new_cost = grid[new_pos[0]][new_pos[1]]
                new_length = length + 1
                if paths[new_cost][new_length] == float('inf'):
                    paths[new_cost][new_length] = new_pos
                    heappush(pq, (new_cost, new_length, new_pos))

    result = []
    for i in range(1, k + 1):
        result.append(paths[i][i][0] * N + paths[i][i][1] + 1)
    result.sort()
    return [grid[(pos - 1) // N][(pos - 1) % N] for pos in result]

def tri(n):
    # Base cases
    if n == 0:
        return [1]
    elif n == 1:
        return [1, 3]
    elif n == 2:
        return [1, 3, 2]

    # Initialize the list with base values
    trib = [1, 3, 2]

    # Calculate the rest of the Tribonacci sequence
    for i in range(3, n + 1):
        if i % 2 == 0:
            trib.append(1 + i // 2)
        else:
            trib.append(trib[i - 1] + trib[i - 2] + trib[i - 3])

    return trib

def is_nested(string):
    stack = []
    for char in string:
        if char == '[':
            stack.append(char)
        elif char == ']':
            if not stack or stack.pop() != '[':
                return False
            elif stack:
                return True
    return False

