def x_or_y(n, x, y):
    return x if is_prime(n) else y

def double_the_difference(lst):
    '''
    Given a list of numbers, return the sum of squares of the numbers
    in the list that are odd. Ignore numbers that are negative or not integers.
    '''
    return sum(num**2 for num in lst if num > 0 and num % 2 == 1)

def even_odd_count(num):
    even_count = 0
    odd_count = 0
    for digit in str(abs(num)):
        if int(digit) % 2 == 0:
            even_count += 1
        else:
            odd_count += 1
    return (even_count, odd_count)

def int_to_mini_roman(number):
    value_map = [
        (1000, 'm'), (900, 'cm'), (500, 'd'), (400, 'cd'),
        (100, 'c'), (90, 'xc'), (50, 'l'), (40, 'xl'),
        (10, 'x'), (9, 'ix'), (5, 'v'), (4, 'iv'), (1, 'i')
    ]
    roman_numeral = ''
    for value, numeral in value_map:
        while number >= value:
            roman_numeral += numeral
            number -= value
    return roman_numeral

def right_angle_triangle(a, b, c):
    sides = sorted([a, b, c])
    return sides[0]**2 + sides[1]**2 == sides[2]**2

def find_max(words):
    words.sort()
    max_unique_chars = 0
    result = ""
    for word in words:
        unique_chars = len(set(word))
        if unique_chars > max_unique_chars:
            max_unique_chars = unique_chars
            result = word
    return result

def do_algebra(operator, operand):
    """
    Given two lists operator, and operand. The first list has basic algebra operations, and 
    the second list is a list of integers. Use the two given lists to build the algebric 
    expression and return the evaluation of this expression.
    """
    expression = str(operand[0])
    for i in range(len(operator)):
        expression += " " + operator[i] + " " + str(operand[i + 1])
    return eval(expression)

def solve(s):
    """Reverse case of letters in a string, or reverse string if no letters."""
    if not any(char.isalpha() for char in s):
        return s[::-1]
    else:
        return ''.join(char.upper() if char.islower() else char.lower() for char in s if char.isalpha()) + ''.join(char for char in s if not char.isalpha())
